// PARSE WHATSAPP MESSAGE FOR ZARA AI SYSTEM
const data = $json || {};

console.log('üì® Processing WhatsApp message for ZARA AI System');

// Handle error cases
if (data.error) {
  console.error('‚ùå Webhook error detected:', data.error);
  return [{ json: {
    error: true,
    message: data.error,
    fallback_response: "I'm experiencing technical difficulties. Please try again in a moment."
  }}];
}

// Extract and validate WhatsApp data
const parsed = {
  // Core message data
  from: data.From || '',
  to: data.To || '',
  body: data.Body || '',

  // WhatsApp specific
  wa_id: data.WaId || '',
  message_sid: data.MessageSid || '',
  profile_name: data.ProfileName || '',

  // Media handling
  num_media: parseInt(data.NumMedia || '0'),
  media_urls: [],

  // AI Agent format
  chat_input: data.Body || '',
  user_id: data.From || data.WaId || '',
  session_id: `wa_${data.WaId || data.From}`,

  // Supabase storage format
  wa_message_sid: data.MessageSid || '',
  wa_id: data.WaId || '',
  from_number: data.From || '',
  to_number: data.To || '',
  media_count: parseInt(data.NumMedia || '0'),
  received_at: new Date().toISOString(),
  direction: 'inbound',
  channel: 'whatsapp',

  // Raw webhook for debugging
  raw_webhook: data
};

// Extract media URLs if present
if (parsed.num_media > 0) {
  for (let i = 0; i < parsed.num_media; i++) {
    const mediaUrl = data[`MediaUrl${i}`];
    if (mediaUrl) parsed.media_urls.push(mediaUrl);
  }
}

// Validate required fields
if (!parsed.from || !parsed.body) {
  console.warn('‚ö†Ô∏è Missing required message data');
  parsed.error = true;
  parsed.fallback_response = "I didn't receive your message properly. Could you please resend it?";
}

console.log('‚úÖ Message parsed for ZARA:', {
  from: parsed.from,
  body_length: parsed.body.length,
  session_id: parsed.session_id,
  media_count: parsed.media_count,
  has_error: !!parsed.error
});

return [{ json: parsed }];

