    // Try to parse JSON response
    try {
      analysis = JSON.parse(agentResponse);
    } catch (e) {
      // If not JSON, create structured analysis
      analysis = {
        memory_action: 'store',
        entity_type: 'general',
        extracted_data: { content: agentResponse },
        confidence: 0.6,
        next_action: 'Store conversation and generate contextual response',
        supabase_operations: ['store_conversation_note']
      };
    }
  } else if (agentResponse && typeof agentResponse === 'object') {
    // Already structured response
    analysis = agentResponse;
  } else {
    // Fallback analysis
