      memory_action: 'none',
      entity_type: 'general',
      extracted_data: {},
      confidence: 0.1,
      next_action: 'Generate basic response',
      supabase_operations: []
    };
  }

  // Extract tool calls if available (from AI Agent execution)
  if (memoryResult.tool_calls || memoryResult.toolCalls) {
    toolCalls = memoryResult.tool_calls || memoryResult.toolCalls || [];
  }

} catch (error) {
  console.error('‚ùå Error processing Memory Picker result:', error.message);
